import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faGithub, faLinkedin, faLinkedinIn } from '@fortawesome/free-brands-svg-icons'


const LandingPage = () => {
    return(
        <div className='mainPage'>
            <h1 className='name'>Dylan Collins</h1>
            <h4>Full Stack Web Developer</h4>
            <nav className='nav'>
                <a style={{paddingRight: '1rem'}} href='https://www.linkedin.com/in/dylan-collins-bb226ba6/'><FontAwesomeIcon color='white' icon={faLinkedin}/></a>
                <a style={{paddingLeft: '1rem'}} href='https://github.com/dylan17th'><FontAwesomeIcon color='white' icon={faGithub}/></a>
            </nav>
        </ div>
    )
}

export default LandingPage;
